using UnityEngine;

namespace PSDInfinite.Editor.Icons
{
    public class PSDIIcons
    {
        #region Constants
        private const string ICON_ARTSTATION = "";
        private const string ICON_LINKEDIN = "";
        private const string ICON_TELEGRAM = "";
        private const string ICON_UPWORK = "";
        private const string ICON_FOLDER = "";
        private const string ICON_IMAGE = "";
        private const string ICON_TEXT = "";
        private const string ICON_BIGFOLDER = "";
        private const string ICON_PSDIFILE = "";
        #endregion

        #region Methods
        public static Texture2D Get(IconType type)
        {
            Texture2D icon = new Texture2D(1, 1);

            switch (type)
            {
                case IconType.BigFolder:
                    {
                        icon.LoadImage(System.Convert.FromBase64String(ICON_BIGFOLDER));

                        break;
                    }
                case IconType.Folder:
                    {
                        icon.LoadImage(System.Convert.FromBase64String(ICON_FOLDER));

                        break;
                    }
                case IconType.Image:
                    {
                        icon.LoadImage(System.Convert.FromBase64String(ICON_IMAGE));

                        break;
                    }
                case IconType.Text:
                    {
                        icon.LoadImage(System.Convert.FromBase64String(ICON_TEXT));

                        break;
                    }
                case IconType.ArtStation:
                    {
                        icon.LoadImage(System.Convert.FromBase64String(ICON_ARTSTATION));

                        break;
                    }
                case IconType.LinkedIn:
                    {
                        icon.LoadImage(System.Convert.FromBase64String(ICON_LINKEDIN));

                        break;
                    }
                case IconType.Telegram:
                    {
                        icon.LoadImage(System.Convert.FromBase64String(ICON_TELEGRAM));

                        break;
                    }
                case IconType.Upwork:
                    {
                        icon.LoadImage(System.Convert.FromBase64String(ICON_UPWORK));

                        break;
                    }
                case IconType.PSDIFile:
                    {
                        icon.LoadImage(System.Convert.FromBase64String(ICON_PSDIFILE));

                        break;
                    }
            }

            return icon;
        }
        #endregion

        #region Enums
        public enum IconType
        {
            Folder,
            Text,
            Image,
            BigFolder,
            ArtStation,
            LinkedIn,
            Upwork,
            Telegram,
            PSDIFile
        }
        #endregion
    }
}